message:
É O POVO QUEM DECIDE: SAIA ÀS RUAS E NÃO VOLTE PRA CASA
Uma sociedade precisa estar extremamente enferma para aceitar que a verdade dos fatos é estabelecida por uma burocracia conhecidamente corrupta e criminosa e não por aquilo que todos sabem. Quem não sabe que Lula, um facínora, só saiu da cadeia porque foi socorrido pelos ministros corruptos que ele mesmo colocou no STF, o qual virou o escritório de uma organização criminosa?

O psicopata do Moraes é um mentiroso contumaz e age como um fora da lei. Censurou, censura e continuará a censurar. Mentiu, mente e continuará a mentir. Não importa se ele usa a burocracia do estado para legitimar as suas decisões criminosas e inconstitucionais. Não existe um país dividido. Não existe um nordeste que não sabe votar. Não se pode acreditar em uma palavra ou resultado divulgado por quem mente e censura, venha de onde vier.

O povo precisa decidir AGORA se quer ficar em casa acuado, c om medo, escondendo-se dos narcotraficantes, ou se sai às ruas para impor sua vontade a TODOS os poderes da república. É hora de decidir se quer ser saqueado e morto, ou se OBRIGARÁ os poderes constituídos a OBEDECER o PODER CONSTITUINTE (o povo).
Esqueça que você precisa de justificativas burocráticas para IMPOR a vontade POPULAR. É o POVO a seiva da burocracia. É do POVO o poder. É o POVO quem determina o que quer. É o POVO quem deve MANDAR e DETERMINAR o seu futuro.

De modo bem prático:
1. Nenhum resultado dito por um censor é verdadeiro;
2. O povo não está dividido entre COMUNISMO/NARCOTRÁFICO e a DIREITA/LIBERDADE;
3. O povo deve sair às ruas em massa, como nunca antes visto, e não voltar pra casa;
4. O povo deve DETERMINAR o que quer (não serei eu que direi o que vocês querem);
5. Não se deve acreditar quando a burocracia diz que a grama é rosa, IMPONHA-SE e lance para longe o papel que não corresponde à realidade;

Faça com que todo o burocrata OBEDEÇA à vontade popular e REJEITE tudo que venha daqueles que se alimentam do dinheiro do pagador de impostos (emissoras de TV, banqueiros, políticos etc.). IMPONHA-SE. Lute pela liberdade enquanto você ainda está VIVO. Depois de morto você não poderá fazer mais nada.

Fique nas ruas e não volte pra casa. Que DEUS nos abençoe.

